const CommunityItem = ({
  id,
  community_name,
  community_picture,
  community_allow,
}) => {
  return (
    <div className="CommunityItem">
      <div>
        <img
          src={process.env.PUBLIC_URL + `assets/${community_picture}.jpeg`}
        />
      </div>
      <div>커뮤니티 이름 : {community_name}</div>
      <div>커뮤니티 결제 허용 : {community_allow}</div>
    </div>
  );
};

export default CommunityItem;
